package chuong2vonglap;
import java.util.Scanner;
public class Loopwhileforcodelearn43 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int a = sc.nextInt();
		int b = sc.nextInt();
		
		for( int i = a; i <= b; i++)
			System.out.print(i+ " ");
	}

}
